/* Loop Code */
// DIDI Indicator, ported by quantum8. Originally by Odir Aguiar on TradingView; a Brazilian MACD
let shortLen = 3
let medLen = 8
let longLen = 20

let candle = record.current // Create everything from candles data

let DidiCurta = 0
let DidiLonga = 0

variable.closes.push(candle.close)
if (variable.closes.length > longLen) {
    variable.closes.splice(0, 1)     // keep array at maximum length

    // create temp array for short
    let shortArr = variable.closes.slice(longLen - shortLen)
    let shortSMA = shortArr.reduce((a, b) => (a + b)) / shortArr.length

    let medArr = variable.closes.slice(longLen - medLen)
    let medSMA = medArr.reduce((a, b) => (a + b)) / medArr.length

    let longSMA = variable.closes.reduce((a, b) => (a + b)) / variable.closes.length


    DidiCurta = shortSMA - medSMA
    DidiLonga = longSMA - medSMA
}
//console.log("DidiCurta: ", DidiCurta)
//console.log("DidiLonga: ", DidiLonga)

variable.value = DidiCurta
variable.signal = DidiLonga

// ensure outputs are always a number
variable.value = isNaN(variable.value) ? 0 : variable.value
variable.signal = isNaN(variable.signal) ? 0 : variable.signal

/* Loop Code */
// Percentage Price Oscillator (PPO)
// Basically an MACD, but using percentage difference between values instead of absolute values
let fastLen = 12
let slowLen = 26
let sigLen = 9


let candle = record.current // Create everything from candles data
let ppo = 0
let signal = 0
let hist = 0

// get fast and slow emas
let fastEMA = calculateEMA(candle.close, variable.ema1prev, fastLen)
variable.ema1prev = fastEMA

let slowEMA = calculateEMA(candle.close, variable.ema2prev, slowLen)
variable.ema2prev = slowEMA

// calculate ppo value
ppo = (fastEMA - slowEMA) / slowEMA * 100

// calculate signal and histogram values
signal = calculateEMA(ppo, variable.ppoEmaPrev, sigLen)
variable.ppoEmaPrev = signal
hist = ppo - signal

variable.value = isFinite(ppo) ? ppo : 0
variable.signal = isFinite(signal) ? signal : 0
variable.hist = isFinite(hist) ? hist : 0


///////////////////////
function calculateEMA(price, previousEMA, periods) {
    let k = 2 / (1 + periods)
    if (isNaN(previousEMA)) {
        return price
    }
    let emaCalc = price * k + previousEMA * (1 - k)
    return emaCalc
}

