/* Loop Code */
// Chande's Q Stick indicator
let pLength = 8
let emaLen = 5


let candle = record.current // Create everything from candles data
let opSum = 0
let clSum = 0
let difference = 0
let outVal = 0

variable.opens.push(candle.open)
variable.closes.push(candle.close)
if (variable.closes.length > pLength) {
    variable.opens.splice(0, 1)
    variable.closes.splice(0, 1)     // keep array at maximum length

    opSum = variable.opens.reduce((a, b) => (a + b))
    clSum = variable.closes.reduce((a, b) => (a + b))

    difference = clSum - opSum

    outVal = calculateEMA(difference, variable.prevEma, emaLen)
    variable.prevEma = outVal
}

variable.value = isFinite(outVal) ? outVal : 0
variable.hist = isFinite(difference) ? difference : 0


///////////////////////
function calculateEMA(price, previousEMA, periods) {
    let k = 2 / (1 + periods)
    if (isNaN(previousEMA)) {
        return price
    }
    let emaCalc = price * k + previousEMA * (1 - k)
    return emaCalc
}
